import { useEffect, useState } from "react";

function Index() {
  const [data, setData] = useState({});
  useEffect(() => {
    getSomethingFromMyAPI().then(response => setData(response));
  }, [setData]);

  return (
    <div>
      <h1>Alo BEBE, QUE TENES PARA MI</h1>
      <p>{data.greeting}</p>
    </div>
  );
}

async function getSomethingFromMyAPI() {
  try {
    const data = await fetch("http://localhost:3001/ping");
    const json = await data.json();
    console.log("DATA", json);
    return json;
  } catch (error) {
    console.log("ERROR", error);
    throw error;
  }
}

export default Index;
